      dataLoadingRequestId
      dataSourceType
      actionType
      noOfRecords
      noOfRecordsProcessed
      requestedAt
      status
      completedAt
      preSignedRemarksS3Url
      dataSheetId
      subSheetName
      pipelineId
      operationType
      updationConfig {
        selectedReferenceFieldIds
        fieldsUpdateType
      }
    }
    ... on SheetDataLoadingRequestAlreadyExists {
      message
      dataLoadingRequestId
      dataSheetId
      subSheetName
    }
    ... on SubSheetNotFound {
      message
      dataSheetId
      subSheetName
    }
    ... on DataSheetNotFound {
      message
      dataSheetId
    }
    ... on DataSheetAccessDenied {
      message
      dataSheetId
    }
    ... on FieldReferencesNotFound {
      message
