query GetDataLoadingRequests($params: GetDataLoadingRequestsParams!) {
  getDataLoadingRequests(params: $params) {
    __typename
    ... on InvalidOffset {
      message
    }
    ... on InvalidLimit {
      message
    }
    ... on UserIsNotAnAdministrator {
      message
    }
    ... on GetDataLoadingRequestsResult {
      dataLoadingRequests {
        __typename
        ... on SheetDataLoadingRequest {
          dataLoadingRequestId
          dataSourceType
          actionType
          noOfRecords
          noOfRecordsProcessed
          failureReason
          requestedAt
          status
          completedAt
          preSignedRemarksS3Url
          dataSheetId
          subSheetName
          operationType
          updationConfig {
            selectedReferenceFieldIds
            fieldsUpdateType
          }
          creationConfig {
            referenceFieldsToCompareInRecords
            referenceFieldsToCompareFromSheet
          }
        }
      }
      totalCount
    }
    ... on PipelinesNotFound {
      message
      pipelineIds
    }
    ... on PipelinesAccessDenied {
      message
      pipelineIds
    }
  }
}

